          <th></th>
        </tr>
        {
        user.map((item, index) => 
          <tr key={index}>
            <td>{item.id}</td>
            <td></td>
            <td></td>
            <td></td>
          </tr>
    )
        }
      </table>
    </>
  );
};

export default Api;
